import React from 'react'
import Card from '../component/Card'
export default class CardContainer extends React.Component{
    state = {
        cardAttributes: []
    }

    mapFunc =() =>{
        let arr = []
        for (let i = 0; i < 25; i++){
            arr.push(this.props.cards[i])
            arr.push(this.props.colors[i])
        }
        return arr
    }


    render(){
        this.state.cardAttributes = this.mapFunc()
        return (
            <div>

            </div>
        )
    }
}
